(51, 1, '2013-07-25 05:50:24', '2013-07-25 05:50:24', '<div>\r\n\r\nThe Grasse Fragrance Company, Inc. is a private corporation specializing in the supply of fragrances and packaging for the cosmetics and personal care market in the Philippines. Established in 2006, the company is the exclusive distributor of Expressions Parfumees, a prestigious fragrance house based in the worlds perfume capital - Grasse, France.\r\n\r\nExpressions Parfumees operates in the 5 major perfumery market segments: Fine Fragrances, Cosmetics, Environmental Fragrances, Toiletries, and Industrial Perfumery. A team of experienced perfumers from Expressions Parfumees work in direct contact with The Grasse Fragrance Company and offer access to Expression Parfumees fragrance library consisting of tens of thousands of compositions, along with yearly visits to the Philippines to give technical training and marketing updates. This gives the local team specialized knowledge and training, providing the highest potential to match market trends worldwide.\r\n\r\nThe Grasse Fragrance Company carries a wide range of quality fragrances and accommodates lower minimum order quantities at competitive prices that would answer to the specific needs of our customers. The company also has a wide range of fragrances in-stock.\r\n\r\nThe Grasse Fragrance Company has paired up with the industrys best manufacturers of glass and PET bottles from different parts of the world. Sourcing these products is the number one priority of the company to be able to offer and provide clients with specialized and innovative packaging designs. A wide range of packaging solutions is available in-stock.\r\n\r\nThe Grasse Fragrance Company offers concepts, marketing and packaging ideas to assist the launch of new products into the market. Fragrance making seminars, cost analysis training, as well as business development, management, and marketing training are provided as a specialized service. A top fragrance sales specialist, trained in Grasse, France heads the team of fragrance sales specialists in the Company.\r\n\r\nOur mission is to service the growing cosmetics and personal care industries in the Philippines with quality fragrances and packaging, in the standard of quality met by European standards. We aim to create and provide business opportunities for our customers to achieve sweet smelling success!\r\n\r\n</div>', 'About', '', 'publish', 'open', 'open', '', 'about', '', '', '2013-07-29 03:51:58', '2013-07-29 03:51:58', '', 0, 'http://grassefragrance.com/?page_id=51', 0, 'page', '', 0),
