faq_05" title="In diam dolor, dignissim at adipiscing vitae"]\r\nIn diam dolor, dignissim at adipiscing vitae, placerat ut ipsum. Proin turpis mauris, semper adipiscing diam eget, pulvinar eleifend metus. Nulla odio tortor, aliquam at metus vel, gravida auctor elit. Vivamus cursus vestibulum orci ac convallis. Vestibulum consectetur metus eget dolor sodales egestas.\r\n[/ev_faq_content]\r\n\r\n[ev_faq_close/]', 'frequently asked questions', '', 'inherit', 'open', 'open', '', '54-revision-7', '', '', '2013-07-31 01:50:58', '2013-07-31 01:50:58', '', 54, 'http://grassefragrance.com/54-revision-7/', 0, 'revision', '', 0),
