(123, 1, '2014-01-17 06:32:22', '2014-01-17 06:32:22', '[ev_faq_open type="link"/]\r\n[ev_faq_link id="ev_faq_01"]Products[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_02"]Ordering[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_03"]Paying for Orders[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_04"]Ordering in Bulk[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_05"]Receiving Orders[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_06"]How do I start selecting a fragrance?[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_07"]Where do our fragrances come from?[/ev_faq_link]\r\n[ev_faq_link id="ev_faq_08"]What makes WP''s perfume special?[/ev_faq_link]\r\n\r\n[ev_faq_link id="ev_faq_09"]Where does inspiration from our fragrances come from?[/ev_faq_link]\r\n\r\n[ev_faq_close/]\r\n\r\n<b>If you have any other questions or concerns about our company, please dont hesitate to call us at </b><b>890-8269 or send an email at </b><a href="mailto:grassefragrance@gmail.com"><b>grassefragrance@gmail.com</b></a><b>.</b>\r\n\r\n[ev_faq_open type="content"/]\r\n\r\n[ev_faq_content id="ev_faq_01" title="Products"]\r\n<div>\r\n\r\nAt WP, we produce several products available for purchase.\r\n\r\n</div>\r\nPersonal Care:\r\n<div>\r\n<ul>\r\n	<li>Shampoo/Conditioner</li>\r\n	<li>Body Wash/Soap/Scrub</li>\r\n	<li>Hand Sanitizer</li>\r\n	<li>Deodorant</li>\r\n	<li>Insect Repellent</li>\r\n</ul>\r\nOils:\r\n<ul>\r\n	<li>Fragrance oils</li>\r\n	<li>NATCO fragrances (Natural compound fragrances that pass European and American ECO standards)</li>\r\n</ul>\r\n</div>\r\n<div>\r\n\r\nPackaging:\r\n<ul>\r\n	<li>PET Bottles (Pump Spray/Lotion Pump/Gel Pump)</li>\r\n	<li>Glass Bottles</li>\r\n	<li>Jars</li>\r\n	<li>Decorative Boxes</li>\r\n</ul>\r\nOther:\r\n<ul>\r\n	<li>Diffusers</li>\r\n	<li>Reed Sticks</li>\r\n</ul>\r\n</div>\r\nPlease feel free to contact us for additional information about our products and supplies.\r\n[/ev_faq_content]\r\n\r\n[ev_faq_content id="ev_faq_02" title="Ordering"]\r\n\r\nOrdering is a very simple and user-friendly process through our website. No registration is required.\r\n<ul>\r\n	<li>You can browse through our product categories at the top of our page, and easily search for your desired products by using our filter search.</li>\r\n	<li>You can directly place your orders through the website. Visit the product page of the item you wish to purchase, select the product, and click the ADD TO CART button.</li>\r\n	<li>Once you are done selecting your items, click on the cart labeled Your Basket and then proceed to checkout.</li>\r\n</ul>\r\nYou may likewise email your orders to <a href="mailto:grassefragrance@gmail.com">grassefragrance@gmail.com</a> or call us at 890-8269. Office hours are from Monday  Saturday, 9:30am  6:30pm.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_content id="ev_faq_03" title="Paying for Orders"]\r\n\r\nPayments are accepted via bank deposits through our BDO account. You may also pay at our local office using cash or credit card.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_content id="ev_faq_04" title="Ordering in Bulk"]\r\n\r\nWP products are available for wholesale purchases. We consider bulk purchases to be a minimum of:\r\n<ul>\r\n	<li>10,000 pieces per packaging material (bottles)</li>\r\n	<li>25kg for fragrances</li>\r\n</ul>\r\nPlease contact us for inquiries or use our bulk order process form <del>here</del>.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_content id="ev_faq_05" title="Receiving Orders"]\r\n\r\nOur office is open for on-site order and pick-ups (Please go <a href="http://grassefragrance.com/contact/">here</a> to see a map of our location.) We can also ship our products via courier of your choice, or we can ask our local courier to provide a price quote. Our ordering procedure is as follows:\r\n<ol>\r\n	<li>You may order either online or contact us (via email or phone) with your order.</li>\r\n	<li>Indicate whether you will pick it up or want it shipped. (IMPORTANT: If you choose the shipping method, please sign our shipping waiver form found here. Failure to do so may result in not being able to carry out your order.)</li>\r\n	<li>Please allow 2  3 business days for your order to be confirmed.</li>\r\n	<li>Deposit the fees (both for the order and shipping) to our BDO account. You may also pay on-site at our local office.</li>\r\n	<li>After the payment is confirmed we will ship out your order as soon as possible.</li>\r\n</ol>\r\n[/ev_faq_content]\r\n\r\n[ev_faq_content id="ev_faq_06" title="How do I start selecting a fragrance?"]\r\n\r\nAt WP, we try our best to match your preferences, and in doing so we offer a perfume mixing seminar that teaches you how to mix your own fragrance to create the perfect blend tailored to you.\r\n\r\n<em id="__mceDel">Our perfume mixing seminar is priced at PHP 990 which includes:</em>\r\n<ul>\r\n	<li>A course explaining each of the raw materials used to make a perfume</li>\r\n	<li>A course teaching you how to make your own fragrance product</li>\r\n	<li>A lesson bag that contains what you need to make your very own perfume.</li>\r\n</ul>\r\n[/ev_faq_content]\r\n\r\n[ev_faq_content id="ev_faq_07" title="Where do our fragrances come from?"]\r\n\r\nAll of our fragrances are imported from the fragrance capital of the world, Grasse, France. At the Grasse Fragrance Company, we offer a wide selection of fragrances that are created by the top perfumers in the industry.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_contentid="ev_faq_08"]What makes WP''s perfume special?]\r\n\r\nOur perfumes are tailor-made for each customer to their personal liking. We provide an array of different fragrances and packaging options to ensure that all our customers are satisfied with their finished product.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_contentid="ev_faq_09"]Where does inspiration from our fragrances come from?]\r\n\r\nWe take inspiration from existing fragrances in the market and add a personalized touch to them. We only use existing fragrances to help customers determine what kind of fragrance they like for comparison.\r\n\r\nWe try to produce the best perfumes for our customers. Although our raw materials come from France, there are slight differences between how fragrances smell when exposed to different temperatures and conditions, as well as cultural diversity in fragrance preferences between Asian, European, and American markets.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_close/]', 'Frequently Asked Questions', '', 'inherit', 'open', 'open', '', '54-revision-17', '', '', '2014-01-17 06:32:22', '2014-01-17 06:32:22', '', 54, 'http://grassefragrance.com/54-revision-17/', 0, 'revision', '', 0),
