. We only use existing fragrances to help customers determine what kind of fragrance they like for comparison.\r\n\r\nWe try to produce the best perfumes for our customers. Although our raw materials come from France, there are slight differences between how fragrances smell when exposed to different temperatures and conditions, as well as cultural diversity in fragrance preferences between Asian, European, and American markets.\r\n\r\n[/ev_faq_content]\r\n\r\n[ev_faq_close/]', 'Frequently Asked Questions', '', 'inherit', 'open', 'open', '', '54-revision-21', '', '', '2014-01-17 06:40:52', '2014-01-17 06:40:52', '', 54, 'http://grassefragrance.com/54-revision-21/', 0, 'revision', '', 0),
(128, 1, '2014-01-17 06:46:25', '2014-01-17 06:46:25', 'Interested in mixing your own perfumes? Dont know where to start? At the Grasse Fragrance Company, we offer a seminar teaching you exact that! The perfect course to teach you all you need to know how to mix your own fragrances, whether youre starting your own business, or if you just want to learn!\r\n\r\n \r\n\r\nOur perfume mixing seminar starts at <b>PHP 990</b> and offers:\r\n\r\nHands-on training with our staff that teaches you how to start mixing your own perfumes\r\n\r\nA starter kit that contains all the materials needed to mix your own perfume including:\r\n<ul>\r\n	<li>125ml perfume oil</li>\r\n	<li>1liter of Alcohol</li>\r\n	<li>10g of fixative</li>\r\n	<li>300g of lotion base</li>\r\n	<li>6 assorted bottles</li>\r\n	<li>The WP manual reference guide</li>\r\n</ul>\r\nWhy wait? Come down to WP and take a lesson today!', 'Perfume Mixing Seminar', '', 'publish', 'open', 'open', '', 'perfume-mixing-seminar', '', '', '2014-01-17 06:46:25', '2014-01-17 06:46:25', '', 0, 'http://grassefragrance.com/?p=128', 0, 'post', '', 0),
