(130, 1, '2014-01-17 06:47:51', '2014-01-17 06:47:51', 'We now offer labeling services for your bottles! If you want to have a label on your bottles or Jars, please follow the steps below:\r\n\r\n<b>Step 1: </b>Choose a design  Pick a design from our list! [Maximum 3 designs per page]\r\n\r\n<b>Step 2: </b>Choose how many to print  How many labels do you want to print? [Maximum per page depends on label size]\r\n\r\n<b>Step 3:</b> Select a name for your fragrance  Pick a name that you would like to put on the label!\r\n\r\n<b>Step 4: </b>Choose your container Type  Pick the size of the bottle or Jar you would like to put the label on! [1 size per page]\r\n\r\n<b>Step 5:</b> Confirm steps 1 to 4  Please make sure all the information for steps 1 to 4 is correct before we start printing!', 'Grasse Fragrance Labeling', '', 'trash', 'open', 'open', '', 'labeling', '', '', '2014-01-17 06:51:18', '2014-01-17 06:51:18', '', 0, 'http://grassefragrance.com/?p=130', 0, 'post', '', 0),
